import {
  Column,
  Stack,
  Card,
  Box,
  Columns,
  Inline,
  Placeholder,
  Tiles,
  Text,
  ButtonIcon,
  IconBookmark,
  Button,
} from 'braid-design-system';
import { Component } from 'react';

export class Game extends Component {
  render() {
    return (
      <Tiles columns={4}>
        <Button variant='solid'></Button>
        <Button variant='solid'></Button>
        <Button variant='solid'></Button>
        <Button variant='solid'></Button>
        <Button variant='solid'></Button>
        <Button variant='solid'></Button>
        <Button variant='solid'></Button>
        <Button variant='solid'></Button>
        <Button variant='solid'></Button>
        <Button variant='solid'></Button>
      </Tiles>
    );
  }
}
